    lng: 74.0060
  };

function Google() {
      let map;
      const google=window.google

        return (
          <>
            <h1>Google Map</h1>
            <div id="map"></div>
            <script>
              function initMap() {
                map = new google.maps.Map(document.getElementById('map'), {
                    center: {lat: -34.397, lng: 150.644},
                    zoom: 8
                  })
                }                
            </script>
            <script defer src="https://maps.googleapis.com/maps/api/js?key=AIzaSyDHIz1Qj4tht33FJqlVUPzzXh0oshAW0Ig&callback=initMap">
            </script>
          </>
        );
}

export default Google;
